import './App.css';
import NavBar from './NavBar/NavBar';
import items from './items';
import Item from './Item/Item';

function App() {
  return (
    <div className="App">
      <NavBar/>
      <div className="items-container">
        {items.map(i => <Item name={i.name}/>)}
        <input type="file"/>
      </div>
    </div>
  );
}

export default App;
